import styled from "styled-components"

export default function Aside({
    children,
    width = 'auto',
    minWidth = '',
    maxWidth = '',
    customStyle = '',
}) {

    const Aside = styled.aside`
        width: ${width};
        min-width: ${minWidth};
        max-width: ${maxWidth};
        ${customStyle};
    `;
    return (
        <Aside>
            {children}
        </Aside>
    );
}
